/*Data for the table `reports` */

insert  into `reports`(id,report_id,team_id,title,title_ja,date_time,author,issue,issue_year,project_id,dept_id,attend_person,attend_other_person,language,translatable,type,content,content_ja,seen,created_at,updated_at) values (8,'tb_0008',1,'Thư mục &quot;2004-3&quot; cho các món ăn thông thường trên Xserve đã biến mất','Xserve上の常備菜「2004-3」フォルダが無くなりました','2020-03-20 14:44:00','8','60',NULL,8,2,NULL,NULL,'ja',1,'Trouble','<h4><strong>Nội dung của sự cố</strong></h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Thư mục \"2004-3\" chứa các tệp InDesign cho Tsukibina 4-3 đã biến mất.</span></p><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Kết thúc công việc vào ngày 11 tháng 3, nó đã có trên máy chủ.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Có một cuộc trở lại trường học vào ngày 18 tháng 3, và khi tôi cố gắng làm việc, tôi nhận ra rằng thư mục [4-3] đã biến mất.</span></li></ul><p style=\"margin-left:40px;\"><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;xserve</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">　├pal_works</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">　├JOBISAI_kilala</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">　　├Job</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├01_Rule</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├02_Backnumber</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├03_Feedback</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├04_Schedule</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├05-Completed</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├2004-3(edit)　←Thư mục này đã bị xóa</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├2004-4</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├2004-5&nbsp;</span></p><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Tôi nghi ngờ thư mục có thể đã được di chuyển và tôi đã tìm kiếm theo tên thư mục (nơi tôi đã tìm kiếm: Xserve, Xserve6, local local) nhưng không thể tìm thấy thư mục.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Tôi đã trình báo với Vương và nhờ tìm kiếm nhưng không thấy.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Chúng tôi đã tóm tắt dữ liệu đã gửi trong BOX và hướng dẫn chỉnh sửa cho đến nay, và thực hiện lại từ tạo mới cho đến trước khi quay lại trường một lần nữa. Chúng tôi đã so sánh tệp đã được làm lại và tệp PDF đã được gửi tới BOX và xác nhận rằng không có sự khác biệt.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Đến khoảng 11h ngày 18/3, khi tìm tên hồ sơ trên máy tính của Vy thì có một tài liệu đã được sửa lại bằng cách quay lại trước giờ học. Tôi đã xuất tệp PDF và xác nhận rằng nó không khác với tệp đã gửi.</span></li></ul><h4>Nguyên nhân của rắc rối</h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Tôi đã tìm kiếm nó vì tôi đã di chuyển nó đến một vị trí khác trên máy chủ, nhưng nó không có ở đó. Có vẻ như khi nhiều công việc chồng chéo lên nhau, một thành viên trong nhóm đã vô tình xóa nó đi và không để ý. Đó là một thành viên của nhóm DTP có quyền xóa thư mục, nhưng không ai nhớ đã xóa nó.</span></p><h4>Làm cách nào để cải thiện</h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Một nhóm DTP sẽ tổ chức một buổi học về cách xử lý các thư mục trên máy chủ.</span></p><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Nếu lỡ xóa hoặc di chuyển dữ liệu trên Xserve, hãy báo ngay cho Wan để khôi phục dữ liệu (* Trường hợp này, thông báo mất dữ liệu đã quá muộn). Tôi không thể phục hồi).</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Nếu không thể khôi phục được, trước tiên hãy tìm kiếm máy chủ và máy tính cá nhân theo tên thư mục hoặc tên tệp.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Nếu nó không được tìm thấy ở bất cứ đâu, hãy bắt đầu lại.</span></li></ul><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Kể từ bây giờ, người điều hành và người quản lý tiến độ sẽ luôn lưu trữ dữ liệu sao lưu trên máy tính cá nhân của họ.</span></p><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Trước khi người vận hành làm việc, hãy sao chép dữ liệu thực phẩm thông thường của Xserve vào máy tính cá nhân và sửa lại trên máy tính cá nhân.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Người vận hành tải dữ liệu đã chỉnh sửa lên Xserve sau khi làm việc. Nếu có chỉnh sửa thêm sau khi tải lên, tôi sẽ sửa lại dữ liệu trên máy tính cá nhân của mình và tải lên Xserve. Bằng cách làm này, cùng một dữ liệu mới nhất vẫn còn trên PC của nhà điều hành và Xserve. Quy trình làm việc này cũng giống như đối với Tutsione.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Trình quản lý tiến độ lưu tệp InDesign mới nhất trên PC của anh ấy trước khi gửi cho người chỉnh sửa của YUIDEA. Bằng cách này, người vận hành và người quản lý tiến độ sẽ lưu dữ liệu mới nhất cho nhau và ngay cả khi dữ liệu của Xserver bị mất, dữ liệu của máy tính cá nhân vẫn có thể được sử dụng để tiếp tục.</span>&nbsp;<br>&nbsp;</li></ul>','<h4>トラブルの内容</h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">常備菜4-3のInDesignファイルが入った「2004-3」フォルダが無くなりました。</span></p><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">3月11日の作業が終わった時点では、サーバーにありました。&nbsp;</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">3月18日に再校戻しがあり、作業しようとしたら、【4-3】フォルダが無くなったのに気が付きました。</span></li></ul><p style=\"margin-left:40px;\"><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;xserve</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">├pal_works</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">├JOBISAI_kilala</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">　　├Job</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├01_Rule</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├02_Backnumber</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├03_Feedback</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├04_Schedule</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├05-Completed</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├2004-3(edit)　←このフォルダが削除された</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├2004-4</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├2004-5&nbsp;</span></p><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">フォルダが移動された可能性を考え、フォルダ名で検索しました（検索したところは：Xserve, Xserve6, 個人のローカル）が、フォルダを見つけられませんでした。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">ワンに報告して、検索してもらいましたが、それでも見つかりませんでした。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">BOXにある入稿データと今までの修正指示をまとめ、新規作成から再校前戻しまでやり直しました 。やり直したファイルとBOXに提出したPDFとを比べ、異なっていないことを確認しました。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">3月18日11時ごろ、VyさんのPCでファイル名を検索すると、再校前戻しで修正したドキュメントがありました。PDFを書き出し、提出したファイルと比べ、異なっていないことを確認しました。</span></li></ul><h4>トラブルの原因</h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">サーバー上の別の場所に移動させたのかと考え、検索しましたが、ありませんでした。 いろいろな作業が重なった際に、メンバーの誰かがうっかりして削除し、気が付かなかったというのが原因だと思われます。フォルダを削除する権限があるのは、DTPチームのメンバーですが、だれも削除した記憶がありません。&nbsp;</span></p><h4>改善方法</h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">サーバー上のフォルダの取り扱い方法について、DTPチームで勉強会を行います。</span></p><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;Xserveのデータを間違って削除や移動などの操作をしてしまったら、データを回復するために直ぐにワンに報告する（※今回の場合は、データがなくなった事に気が付いたのが遅かったためデータを回復出来なかった）。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;回復出来ない場合は、最初にフォルダ名やファイル名などでサーバーと個人PCで検索する。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">どこにもなかった場合には、最初から作り直す。</span></li></ul><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;今後は、オペレーターと進行管理者はいつも個人PCにバックアップのデータを保存します。</span></p><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">オペレーターが作業する前にXserveの常備菜データを個人PCにコピーし、個人のPCで修正する。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">オペレータは、作業後に、修正したデータをXserveにアップする。アップ後に追加の修正があれば、個人PCのデータを改めて修正し、Xserveにアップする。こうすることで、オペレータのPCとXserveに同じ最新のデータが残る。この作業フローはツチオネと同じである。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">進行管理者は、YUIDEAの編集者へ提出する前に、最新のInDesignファイルを自分のPCに保存する。こうすることで、オペレーターと進行管理者はお互いに最新のデータを保存することになり、Xserverのデータがなくなった際にも、個人PCのデータで進められる。&nbsp;</span><br>&nbsp;</li></ul>','11,2,3,1,39,38,9,12,16,49,42,21,17','2020-08-25 07:06:11','2020-11-02 04:45:41'),(23,'tb_0023',1,'P21 bị thiếu trong tệp PDF','再校PDFファイルからP21が抜けました','2020-03-24 10:23:00','3','68',NULL,21,2,NULL,NULL,'ja',1,'Trouble','<h4>Nội dung của sự cố</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Gock đã thực hiện \"công việc kết hợp\" của PDF, nhưng tại thời điểm đó, tôi đã giao nó cho YUIDEA mà không nhận thấy rằng 21 trang bị thiếu.</span></li></ul><h4>Nguyên nhân của rắc rối</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Trước khi hợp nhất, tôi đã kiểm tra số lượng tài liệu và tệp PDF và kiểm tra xem tất cả các trang đã hoàn tất chưa.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Các thư mục được sắp xếp theo \"loại\" để tách các tài liệu PDF và InDesign. Tất cả các tệp PDF tách biệt đã được chọn và tệp kết hợp đã được tạo.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Tôi đã hiển thị tệp PDF đã hoàn thành, nhưng tôi không xác nhận rằng số trang trong thanh công cụ của Acrobat là 24 trang cho tất cả các trang. Vì vậy, tôi đã không nhận thấy rằng 21 trang bị thiếu trong PDF. Có một số sai lầm trong hoạt động, nhưng việc thiếu xác nhận của gock là nguyên nhân chính lần này.</span></li></ul><h4>Làm cách nào để cải thiện</h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Chúng tôi sẽ tuân theo các quy tắc về xác nhận của ông Miyano và làm việc theo đó. Tôi xin lỗi.</span></p>','<h4>トラブルの内容</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">PDFの「結合作業」をゴックが行いましたが、その際、21ページが抜けていることに気づかずYUIDEAへ納品しました。</span></li></ul><h4>トラブルの原因</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">結合前に、ドキュメントとPDFの数を付き合わせて、全ページが揃っているかを確認しました。&nbsp;</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">フォルダ内を「種類」でソートし、PDFとInDesignドキュメントを分別しました。 分別したPDFファイルを全部選択して、結合ファイルを作りました。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">出来上がったPDFを表示しましたが、アクロバットのツールバーにあるページ数が全ページ分の24ページあることを確認しませんでした。 そのため、PDFから21ページが抜けたことに気が付きませんでした。 操作ミスもありますが、ゴックの確認不足が今回の主な原因です。&nbsp;</span></li></ul><h4>改善方法</h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">宮野さんから教えていただいた確認のためのルールを守り、作業します。申し訳ありませんでした。</span></p>','11,2,18,3,16,1,39,38,9,12,42,49,17','2020-08-27 01:43:48','2020-11-02 04:37:34'),(24,'tb_0024',1,'[4-5] Tệp PDF để gửi đã được tạo bằng dữ liệu cũ','【4-5】納品用PDFファイルを古いデータで作成しました','2020-04-06 10:46:00','3','69',NULL,21,2,NULL,NULL,'ja',1,'Trouble','<h4>Nội dung của sự cố</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Có 3 thành viên ở Việt Nam có thể làm việc trên \"Kinari Select\". Ai sẽ làm việc phụ thuộc vào số tiền thâm hụt được trả lại và tình hình kinh doanh. Hôm đó anh Tamura đồng ý nên tôi yêu cầu Trâm tạo PDF giao hàng.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Trâm hiểu nhầm là \"không có chỉnh sửa\", mở thư mục \"Saikou\" và tạo bản PDF để gửi bằng tài liệu chưa chỉnh sửa trong thư mục \"INDD\" của trường lùi 1. Vào thời điểm đó, tôi mở hai hoặc ba tệp cùng một lúc và chọn \"Xuất\" từ menu \"Tệp\" để xuất PDF. Do đó, số lần xuất không theo thứ tự trang.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Ngọc làm một tệp PDF đã ghép và kiểm tra các dấu còn thiếu và điểm đặt trước chính xác. Tuy nhiên, tôi không nhận ra rằng nó đã lỗi thời vì tôi đã không kiểm tra các tài liệu tôi đã sử dụng.</span></li></ul><h4>Nguyên nhân của rắc rối</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Tôi nghĩ rằng nguyên nhân của sự cố này là do lỏng lẻo, thiếu xác nhận và quản lý thư mục không đầy đủ.</span></li></ul><h4>Làm cách nào để cải thiện</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Sau đó, việc quản lý dữ liệu sẽ chỉ được thực hiện bởi quản lý tiến độ. Thay đổi như sau để cấu trúc thư mục dễ hiểu.</span></li></ul><p style=\"margin-left:40px;\"><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">├Kinari Select_kilala</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　├Job</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├KS_2020xxx</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　├1.1st</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　├2.Uchiko</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├_Final</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├Uchikou 1</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├Uchikou 2</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　├3.Haneigo</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　├4.Saikou</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├_Final</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├Saikou 1</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├Saikou 2 </span>&nbsp;</p><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Quản lý tiến độ quản lý để tạo thư mục \"_Final\" và đưa dữ liệu mới nhất vào quá trình trả về rất nhiều. Nếu có hướng dẫn chỉnh sửa, chúng tôi sẽ hướng dẫn người vận hành sử dụng tài liệu tại đây, thao tác trên từng PC và khi đồng ý, hãy tải lại tài liệu tại đây. Điều này sẽ ngăn nhà điều hành xử lý sai dữ liệu.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Chúng tôi sẽ quyết định người kiểm soát dữ liệu của trường hợp và quản lý nó một cách chắc chắn. Kiểm tra lại dữ liệu trước khi yêu cầu công việc.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Trước khi làm việc, người vận hành nên kiểm tra dữ liệu kỹ lưỡng trước khi bắt đầu công việc. Nếu bạn có bất kỳ câu hỏi nào, hãy yêu cầu người quản lý tiến độ hỏi bạn ngay lập tức.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Khi kiểm tra kiểm soát tiến độ, trước tiên hãy kiểm tra xem dữ liệu được sử dụng có chính xác không và so sánh với dữ liệu đã gửi ở giai đoạn trước.</span>&nbsp;<br>&nbsp;</li></ul>','<h4>トラブルの内容</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">ベトナムには、「きなりセレクト」の作業を出来るメンバーが3人います。誰が作業するかは、戻しの赤字量、業務の状況によって決まります。 当日、田村さんからOKが出たのでTramに納品PDFの作成を依頼しました。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Tramは「修正がなかった」と勘違いし、「Saikou」フォルダを開き、再校戻し１の「INDD」フォルダの中の、修正前のドキュメントを使って、納品用PDFを作成しました。その際、２～３ファイルを同時に開き、「File」メニューの「Export」を選択し、PDFを書き出しました。このため、書き出した時間がページ順にはなりませんでした。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">NgocがPDFの合体ファイルを作り、マーク抜けと正しいプリセットを使ったかをチェックしました。しかし、使用したドキュメントを確認しなかったため、古いデータであることを気づきませんでした。</span></li></ul><h4>トラブルの原因</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;気の緩み、確認不足、フォルダ管理の不十分さが、今回のトラブルの原因だと思います。</span></li></ul><h4>改善方法</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">以降データ管理は進行管理のみでやっておきます。 フォルダ構成が分かりやすいように、下記の通りに変更します。</span></li></ul><p style=\"margin-left:40px;\"><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;├Kinari Select_kilala</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　├Job</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├KS_2020xxx</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　├1.1st</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　├2.Uchiko</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├_Final</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├Uchikou 1</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├Uchikou 2</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　├3.Haneigo</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　├4.Saikou</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├_Final</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├Saikou 1</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├Saikou 2&nbsp;</span></p><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">戻しが多いプロセスでは「_Final」フォルダを作って最新データを入れるように進行管理が管理します。修正指示があれば、オペレーターにこちらにあるドキュメントを使うように指示し、各PCで作業して、OKが出たら、再びこちらにアップしてもらいます。 こうすることでオペレーターのデータの取り扱いミスを防止できます。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">案件のデータ管理者を決め、しっかり管理します。作業を依頼する前には、再度データを確認します。&nbsp;</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">オペレーターは作業する前に、しっかりデータを確認した上で、作業を始めます。不明点があれば、すぐに進行管理に質問させます。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;進行管理のチェックの際には、使用したデータが正しいのかを最初に確認し、前段階に提出したものと比べます。&nbsp;</span><br>&nbsp;</li></ul>','11,1,2,3,39,38,9,12,40,42,45,49,,21,17','2020-08-27 02:15:54','2020-11-02 08:45:26'),(25,'tb_0025',1,'[5-1] Sau khi phản chiếu, hình ảnh của phần thiết kế trên trang bìa trở nên thô ráp','【5-1】反映後、表紙のデザインパーツの画像が粗くなりました','2020-04-09 11:26:00','3','113',NULL,21,2,NULL,NULL,'ja',1,'Trouble','<h4>Nội dung của sự cố</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Thứ sáu, ngày 3 tháng 4 [5-1] Hoàn nguyên trước khi phản chiếu 3</span>&nbsp;<br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Có một công việc để đưa một hình ảnh vào phần thiết kế của trang bìa.</span>&nbsp;<br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Sau lần kiểm tra đầu tiên, Ngọc hướng dẫn Diệp “chỉnh sửa tạo hình”. Diệp làm hình mới và lên bìa.</span>&nbsp;<br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Thông thường, lưu, xuất tệp PDF và đóng thiết kế trong (Tôi hướng dẫn bạn làm theo trình tự hoạt động này để tránh gặp rắc rối với \"Tsutsuna\").</span>&nbsp;<br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Tuy nhiên, lần này, tôi đã xuất tệp PDF mà không lưu nó và nghĩ rằng nó đã được lưu, chọn \"Không lưu\" và đóng thiết kế trong thiết kế.</span>&nbsp;<br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Bản PDF ổn, vì vậy tôi đã gửi dữ liệu InDesign trước khi sửa đổi sang Nhật Bản.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Thứ Hai, ngày 6 tháng Tư [5-1] Sau khi phản ánh</span>&nbsp;<br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Trâm đã làm bìa. Khi tôi mở tệp trong thiết kế, tôi nhận được thông báo \"cập nhật hình ảnh\", nhưng tôi đã không cập nhật tệp đó và làm việc mà không cập nhật.</span>&nbsp;<br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Tôi đã kiểm tra bằng trình đọc mẫu, nhưng tôi không thể kiểm tra vì đó là bản chỉnh sửa không thay đổi nhiều so với bản PDF trước khi làm việc. Khi tôi kiểm tra tệp liên kết, tôi không nhận thấy rằng hình ảnh bị nhiễu hạt.</span></li></ul><h4>Nguyên nhân của rắc rối</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Nguyên nhân là do Diệp đã sơ suất, báo cáo Trâm không đầy đủ, quản lý tiến độ thiếu kiểm tra.</span></li></ul><h4>Làm cách nào để cải thiện</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Chúng tôi sẽ sử dụng tập lệnh \"xuất PDF\" do ông Furooya tạo ra. Tập lệnh này sẽ cảnh báo bạn nếu tài liệu không được lưu, liên kết hình ảnh bị hỏng, thiếu phông chữ, v.v. Nếu tài liệu chưa được lưu, không thể xuất PDF. Từ bây giờ, khi công nhân viết bản PDF thử nghiệm, hãy đảm bảo sử dụng tập lệnh \"Xuất PDF\".</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Trước khi tải lên dữ liệu, hãy đặt tài liệu và tệp PDF đã xác nhận thành một bộ và xác nhận ngày giờ. Nếu ngày giờ quá xa nhau, nhà mạng sẽ kiểm tra và thử lại. Nếu có bất kỳ thông báo cảnh báo hoặc những điểm chưa rõ ràng trong quá trình làm việc, hãy dừng công việc và báo cáo cho người quản lý tiến độ. Nếu bạn nằm ngoài phạm vi quyền hạn của người quản lý tiến độ, vui lòng liên hệ với người phụ trách YUIDEA (Mr. Saito).</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Đó không phải là điều chúng tôi có thể làm ngay lập tức, nhưng chúng tôi sẽ có thể tuân theo các quy tắc và tuân theo các quy tắc trong khi kiểm tra quy trình cho mọi người trong nhóm DTP.</span>&nbsp;<br>&nbsp;</li></ul>','<h4>トラブルの内容</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">４月３日（金）【5-1】反映前戻し３</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">表紙のデザインパーツに画像入れ作業がありました。</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">１回目のチェックのあとに、NgocがDiepに「画像作成の直し」を指示しました。 Diepが新しい画像作って、表紙に入れました。</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">通常は、保存して、PDFを書き出し、インデザインを閉じます(「常備菜」のトラブルの反省からこの操作順を守るように指示しています)。</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">しかし、今回は保存しないままPDFを書き出し、さらに、すでに保存したものと思い込み「保存しない」を選んで、インデザインを閉じました。&nbsp;</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">PDFがOKでしたので、修正前のInDesignデータを日本に送ってしまいました。&nbsp;</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">４月６日（月） 【5-1】反映後</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Tramが表紙を作業しました。インデザインファイルを開くときに「画像更新」メッセージが出ましたが、進行管理に知らせずに、更新しないまま作業しました。</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">パタパタリーダー使ってチェックしましたが、作業まえのPDFとくらべて大きな変化のない修正であったためチェックできませんでした。 合体ファイルをチェックした際には、画像が粗くなっていることに気が付きませんでした。</span></li></ul><h4>トラブルの原因</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;Diepの保存ミス、Tramの報告不足、進行管理者のチェック不足が今回の原因です。&nbsp;</span></li></ul><h4>改善方法</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">古尾谷さんが作成した「PDF書き出し」スクリプトを使います。このスクリプトは、ドキュメントが保存されていない、画像リンクが外れている、フォントがないなどのとき、警告メッセージが出ます。ドキュメントが保存されなければ、PDFを書き出せない設定なっています。 今後、作業者が校正PDFを書き出すときには、必ず「PDF書き出し」スクリプトを使ってもらいます。&nbsp;</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">データアップ前に、ドキュメントと確認したPDFをセットにして、日付と時間を確認します。日付と時間がかけ離れていたら、オペレータが確認し、再度アップを行います。 作業中に警告メッセージや不明なことがあれば、一旦作業止めて、進行管理者に報告します。進行管理者の権限範囲外の場合には、YUIDEAの案件担当者（斎藤さん）に連絡します。&nbsp;</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">すぐに完璧にできることではありませんが、フローを点検しつつ、DTPチームのメンバー全員でフォローして、ルールを守っていけるにします。&nbsp;</span><br>&nbsp;</li></ul>','11,2,3,1,39,38,9,12,16,42,49,17','2020-08-27 02:55:04','2020-11-02 04:38:05'),(26,'tb_0026',1,'Rắc rối với biển hiệu mini &quot;tôm, cua, sò&quot;','「エビ・カニ・貝類」のミニ看板のトラブル','2020-04-24 12:03:00','3','93',NULL,1,2,NULL,NULL,'ja',1,'Trouble','<h4>Nội dung của sự cố</h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Trong tác phẩm mới của Tutsione số 121, định dạng cũ \"tôm, cua, sò\" đã được sử dụng thay cho định dạng bảng hiệu mini mới nhất \"tôm, cua, sò\".</span></p><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">◎ Ngày 17 tháng 4 (Thứ sáu)</span>&nbsp;<br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Đã hoàn thành trang 18 của số báo danh 121 do Kim Ngọc phụ trách. Thanh kiểm tra và đưa cho Ngok.</span></p><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">◎ Ngày 20 tháng 4 (Thứ Hai)</span>&nbsp;<br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Ngọc đã kiểm tra tất cả các trang, nhưng không tìm thấy lỗi biển hiệu trên P18. Tôi đã giao nó cho Nhật Bản với một số sai sót.</span></p><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">◎ Thứ ba, ngày 20 tháng 4 11:50</span>&nbsp;<br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Một sai sót đã được phát hiện sau khi nộp bản sửa lỗi của trường đầu tiên cho phía Nhật Bản. Đã nhận được yêu cầu định dạng mới nhất từ phía Nhật Bản. Khi tôi kiểm tra dữ liệu mà tôi làm việc, tệp định dạng của Xserve 6 là định dạng mới nhất, nhưng định dạng được lưu trên PC cá nhân của Kim Ngọc và Nguyên không phải là dữ liệu mới nhất.</span></p><h4>Nguyên nhân</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Để đẩy nhanh tiến độ hoạt động, Nguyên sao chép các định dạng thường dùng trong máy tính cá nhân và làm thành văn bản tóm tắt.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Vào ngày 5 tháng 12 năm 2019, có một hướng dẫn cập nhật từ YUIDEA và bảng hiệu nơi bạn có thể nhập văn bản đã được cập nhật. Tuy nhiên, Nguyễn đã không cập nhật ký hiệu \"tôm, cua, sò\" trên tài liệu của mình.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Nguyên đã chia sẻ với Kim Ngọc tài liệu mà Nguyên luôn sử dụng khi dạy người điều hành mới Kim Ngọc của mình về trường hợp của Tutsione.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Kim Ngọc vô tình sử dụng dữ liệu cũ, và người quản lý tiến độ cũng không hay biết là biển báo đã sai.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Vì người quản lý tiến độ đã hướng dẫn người điều hành sử dụng định dạng mới mỗi khi định dạng được cập nhật, anh ta đã bỏ qua việc kiểm tra vì cho rằng \"không nên sử dụng định dạng cũ\".</span>&nbsp;<br>&nbsp;</li></ul><h4>Làm cách nào để cải thiện</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Khi bạn làm việc, cả người điều hành và người quản lý tiến độ đảm bảo rằng các dấu hiệu ở định dạng mới nhất.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Đảm bảo sao chép từ dữ liệu định dạng YUIDEA và sử dụng nó mà không sử dụng dữ liệu bạn đã biên dịch trên PC của riêng mình.</span>&nbsp;<br>&nbsp;</li></ul>','<h4>トラブルの内容</h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">ツチオーネ121号の新規作業で、最新のミニ看板のフォーマット「エビ・カニ・貝類」の代わりに、古いフォーマットの「エビ・カニ・貝」を使用 しました。</span></p><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">◎4月17日（金）</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;Kim Ngocが担当している121号の18ページを完成しました。Thanhがチェックして、ゴックに渡しました。</span></p><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;◎4月20日(月)&nbsp;</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Ngocが全頁チェックしましたが、P18の看板ミスを見つけられませんでした。ミスがあったまま、日本側に納品しました。</span></p><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;◎4月20日（火）11:50&nbsp;</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">初校戻しの修正を日本側へ提出した後、ミスが発覚しました。 日本側から最新フォーマットの要件を受け取りました。作業したデータを確認したところ、Xserve6のフォーマットファイルは最新フォーマットでしたが、Kim NgocとNguyenの個人ＰＣで保管されているフォーマットは最新データではありませんでした。</span></p><h4>原因</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Nguyenは操作を手早くするために、個人のＰＣにフォーマットの中でよく使うものをコピーして、それらをまとめたドキュメントを作っていました。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">2019年12月5日にYUIDEAから更新指示があり、文言が入力できる看板が更新されました。しかし、Nguyenは、いつも使っているドキュメント上の「エビ・カニ・貝類」看板を更新しませんでした。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;Nguyenは新しいオペレーターのKim Ngocにツチオーネの案件を教える際、Nguyenがいつも使っているドキュメントをKim Ngocと共有しました。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Kim Ngocは意識しないうちに古いデータを使用し、 進行管理者はその看板が間違っていることに気が付きませんでした。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">進行管理者は、フォーマット更新の度にオペレーター新しいフォーマットを使うように指示していたので、「古いフォーマットを使用するはずがない」という思い込みもあり、チェックを怠ってしまいました。&nbsp;</span><br>&nbsp;</li></ul><h4>改善方法</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">オペレーターと進行管理者のどちらも、作業時に、看板文字が最新フォーマットかどうかを確かめます。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">自分のPC上でまとめたものを使わずに、必ずYUIDEAのフォーマットデータからコピーし、使用します。&nbsp;</span><br>&nbsp;</li></ul>','1,49,38,42,21,3,17,,16,2','2020-08-27 03:22:16','2021-01-11 15:59:26'),(27,'tb_0027',1,'p13 &quot;Eco Potato&quot;, thẻ con của khu vực sản xuất đã bị xóa','「エコ・じゃがいも」の「産地の子タグ」が削除されました','2020-06-19 12:22:00','3','170',NULL,21,2,NULL,NULL,'ja',1,'Trouble','<h4>Nội dung của sự cố</h4><ul><li>p13 Đã xóa thẻ gắn với văn bản \"khu vực sản xuất\" của \"khoai tây sinh thái\" và cập nhật hiệu chuẩn.</li><li>Khi YUIDEA thực hiện xử lý phản hồi, tôi nhận thấy thiếu thẻ và phát hiện ra lỗi.</li></ul><figure class=\"image\"><img src=\"http://jobtime.cetusvn.net/data/reports/hUv0bCh6dp4kWauEgenHPCwsbTRY3O0u3zTt83ZX.png\"></figure><h4>Nguyên nhân của rắc rối</h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Người điều hành dán văn bản mà không mở \"trình chỉnh sửa câu chuyện\" khi thực hiện sửa đổi. Kết quả là, các thẻ đã biến mất.</span> Nó rất khó tìm do cấu trúc và tôi đã tải nó lên máy chủ mà không nhận thấy bất kỳ lỗi nào.</p><h4>Làm cách nào để cải thiện</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Đảm bảo mở \"Story Editor\" và sửa văn bản của khung sản phẩm. Hãy cẩn thận để làm theo quy tắc này.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Chúng tôi sẽ thêm chức năng kiểm tra tập lệnh xuất PDF để xem cấu trúc XML của Kinari Select có đúng hay không.</span></li></ul>','<h4>トラブルの内容</h4><ul><li>p13「エコ・じゃがいも」の「産地」のテキストに付けられたタグを削除し校正をアップしました。</li><li>YUIDEAがフィードバック処理した際に、タグの不足に気が付きミスが発覚しました。</li></ul><figure class=\"image\"><img src=\"http://jobtime.cetusvn.net/data/reports/hUv0bCh6dp4kWauEgenHPCwsbTRY3O0u3zTt83ZX.png\"></figure><h4>トラブルの原因</h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">オペレータは修正時に「ストーリーエディタ」を開かずに、 テキストをペーストしてしまいました。その結果、タグが無くなりました。</span>構造上では見つけにくく、ミスに気が付くことなくサーバーへアップしました。</p><h4>改善方法</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">商品コマのテキストは、必ず「ストーリーエディタ」を開いてテキストを修正する。というルールをしっかり守るように注意いたします。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">PDF書き出しのスクリプトに、KinariセレクトのXML構造が正しいかどうかのチェック機能を加えて運用します。</span></li></ul>','11,2,3,8,1,39,38,9,12,42,49,,17','2020-08-27 05:31:21','2020-11-02 04:39:13'),(28,'tb_0028',2,'Thiếu sót trong xử lý hình ảnh dâu tây','20201208大地_イチゴのコントラスト','2020-12-08 00:00:00','24','321',NULL,NULL,NULL,NULL,NULL,'ja',1,'Trouble','<h4>Để ý</h4><p>2020/12/08 Makoto Kobayashi</p><p>\"Vietnam Image Retouch Intermediate_20201208.pdf\" đã được cập nhật.</p><p>Dâu tây làm việc ở Việt Nam không có gì tương phản. Do đó, phương pháp xử lý được mô tả ở trang 28.</p><p>Vui lòng chia sẻ nó với nhóm Path và đảm bảo rằng bạn hiểu nó.</p><p>&nbsp;</p><p>Hướng dẫn sử dụng và hình ảnh mẫu được tải lên bên dưới.</p><p>FFFTP&gt; Mẫu chỉnh sửa hình ảnh &amp; Biện pháp phòng ngừa công việc PDF&gt; Thủ công</p><p>・ Trung cấp chỉnh sửa hình ảnh Việt Nam_20201208.pdf</p><p>・ Hình ảnh mẫu của P28</p><p>&nbsp;</p><p>Hình ảnh mẫu cũng được bao gồm, vì vậy vui lòng làm việc theo hướng dẫn sử dụng và kiểm tra sự khác biệt.</p>','<h4>マニュアルとサンプル画像を下記にアップしています。</h4><p>FFFTP&gt;画像レタッチ見本&amp;作業注意点PDF&gt;マニュアル</p><p>・ベトナム画像レタッチ中級_20201208.pdf</p><p>&nbsp;</p><h4>【トラブルの内容】</h4><p>2020/12/08　小林誠</p><p>“ベトナム画像レタッチ中級_20201208.pdf”を更新しました。</p><p>ベトナム作業のイチゴはコントラストが無いです。そこでP28に処理の仕方を記述しました。</p><p>Pathチームで共有し、必ず理解する様にして下さい。</p><p>　</p><h4>【参考画像】</h4><p>サンプル画像も入れていますのでマニュアル通りに作業をしてみて、違いを確認して下さい。</p><p>FFFTP&gt;画像レタッチ見本＆作業注意点PDF&gt;20201208大地_イチゴのコントラスト</p><p>・元画像：PS_KCT_1499L.jpg</p><p>・ベトナム作業：PS_KCT_1499Lベトナム作業.eps</p><p>・日本作業：PS_KCT_1499L日本作業.eps</p><p>&nbsp;</p><h4>【トラブルの原因】</h4><p>RGB☞CMYKにした際に調子が無くなる。</p><p>↳後でコレクションで調整しなければならない色がある。</p><p>FFFTP&gt;画像レタッチ見本&amp;作業注意点PDF&gt;マニュアル</p><p>“ベトナム画像レタッチ中級_20201208.pdf”を更新</p><p>&nbsp;</p><p>【改善方法】</p><p>マニュアルの理解</p>','49,34,37,36,24,21,42,45,1','2020-12-08 13:34:08','2021-01-12 08:47:14'),(29,'nt_0029',2,'20201214 Sakata_Flower màu phù hợp','20201214サカタ_花色合わせ','2020-12-14 15:04:00','24',NULL,NULL,NULL,NULL,'34',NULL,'ja',1,'Notice','<p>【Nội dung Lỗi】</p><p>Thư mục chỉnh hoa sakata</p><p>20201214サカタ_花色合わせ &nbsp;</p><p>&nbsp;</p><p>↳Màu phải đồng bộ</p><p>↳Nếu là hình giống thì chỉnh càng giống càng tốt</p><p>Cùng 1 loại hoa nhưng 1 tấm chụp tổng thể, 1 tấm chụp sát, nếu không chỉnh đồng bộ thì khi xem catalog sẽ rất kì, nên phải chỉnh đồng bộ</p><p>&nbsp;</p><p>【Hình Tham khảo】có up chỗ bên dưới</p><p>FFFTP&gt;画像レタッチ見本＆作業注意点PDF&gt;20201214サカタ_花色合わせ</p><p>NG:SKT_017_0411Mベトナム.psd &nbsp; &nbsp;Việt Nam làm</p><p>OK:SKT_017_0411M日本.psd &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Tokyo &nbsp;làm</p><p>見本:SKT_017_0412M.psd &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Mẫu</p><p>&nbsp;</p><p>【Nguyên nhân lỗi】</p><p>Khi làm phải hiểu được tổng thể hình</p><p>【Cách cải thiện】</p><p>Hiểu được tổng thể hình</p>','<h4>【トラブルの内容】</h4><p>20201214サカタ_花色合わせ</p><p>↳花の色は合わせる</p><p>↳同じ花と判断したら、なるべく合わせる。</p><p>&nbsp; 花のアップ画像と全体画像なので花のイメージが違うとカタログで見た場合</p><p>&nbsp; 統一されていないとNG</p><p>　</p><h4>【参考画像】</h4><p>FFFTP&gt;画像レタッチ見本＆作業注意点PDF&gt;20201214サカタ_花色合わせ</p><p>NG:SKT_017_0411Mベトナム.psd</p><p>OK:SKT_017_0411M日本.psd</p><p>見本:SKT_017_0412M.psd</p><p>&nbsp;</p><h4>【トラブルの原因】</h4><p>マニュアルに記載しているが、全体を把握して画像レタッチ作業を行う</p><p>&nbsp;</p><h4>【改善方法】</h4><p>画像全体の把握</p>','49,34,37,36,38,24,21,42,,18,1','2020-12-14 13:13:28','2021-01-12 08:49:22'),(30,'tb_0030',2,'Không làm theo đúng yêu cầu trong bảng','伝票の指示に従っていませんでした。','2020-12-23 16:21:00','34','321',NULL,58,5,NULL,NULL,'ja',0,'Trouble','<p>「j_【コトコト生活用品】_加工1点」です。</p><p>Thư mục này đã không làm theo đúng yêu cầu trong bảng<br>Là ghép hình loại image nhưng mình lại để path<br>Mọi Người phải kĩ hơn nữa nha</p><h4>&nbsp;</h4>','<p>「j_【コトコト生活用品】_加工1点」です。</p><p>角版です。</p><p>伝票の指示に従っていませんでした。</p><p>↓↓↓作業注意レポートはこんな感じにした方が解りやすい。</p><p>＝＝＝＝＝＝＝＝＝＝</p><p>日付：2020/12/23（水）</p><p>案件名：コトコト生活用品　「j_【コトコト生活用品】_加工1点」</p><p>内容：角版同士の合成指示に対し、切り抜き同士の合成としてしまった。</p><p>　　　↳伝票の指示に従っていませんでした。</p><p>対応：時間が無かったので、日本で対応する。（アクションはマイナス）</p><p>＝＝＝＝＝＝＝＝＝＝</p><h4>&nbsp;</h4>','49,34,37,36,38,,24,21,42,1','2020-12-23 16:40:36','2021-01-12 08:48:02'),(38,'nt_0038',2,'大地_真珠チラシ/Đồng bộ màu nền','20210106大地_真珠チラシ/バック色合わせ','2021-01-06 12:07:00','25','321',NULL,NULL,NULL,NULL,NULL,'ja',0,'Notice','<p><span class=\"text-big\"><strong>大地_真珠チラシ</strong></span></p><p>【Nội dung】2021/1/6</p><p>大地_真珠チラシ/バック色合わせ Đồng bộ màu nền</p><p>Đồng bộ màu nền những hình cùng 1 Thợ chụp, cùng môi trường chụp</p><p>↳Những trường hợp nói trên đây, chắc chắn phải làm sao cho thấy được màu nền giống nhau</p><p>↳Khi đăng báo nếu màu nền rời rạc không đồng bộ là không được<br>・Việc đồng bộ màu nhạt là khó nhưng phải đồng bộ<br>・Cái DS-07892482-02A.eps và DS-07892490-02A.eps đang không đồng bộ (có thể thấy là màu đỏ tím và xanh tím)</p><p>【Hình tham khảo】có up trên FTP<br>FFFTP&gt;画像レタッチ見本＆作業注意点PDF&gt;20210105大地_バック色合わせ<br>YUIDEA修正　/　ベトナム修正</p><p>【Nguyên nhân】<br>Không hiểu tổng thể hình trên Bridge...</p><p><br>【Cách cải thiện】</p><p>(1) Hiểu tổng thể hình trên Bridge...</p><p>(2) Cũng có những trường hợp màu sắc có thể khác nhau ở bên trái và bên phải của màn hình, &nbsp;nên hãy di chuyển hình ảnh trên màn hình để kiểm tra. Để hình ảnh &nbsp;trông \"giống màu\" dù hiển thị ở đâu bên trái, bên phải, trên hoặc dưới màn hình thì Kilala cũng đã có cân màu màn hình rồi nhưng màn hình Việt Nam khó chỉnh, nên với những hình màu nhạt khó thì sau khi đã retouch hình xong cần nên thử kéo để trên dưới trái phải màn hình thử sao</p><p>※Anh Koba không thể check được nguyên nhân từ màn hình nên Bên Kilala tự kiểm tra dùm anh.</p>','<p><span class=\"text-big\"><strong>大地_真珠チラシ</strong></span></p><p><strong>【トラブルの内容】2021/1/6</strong><br>大地_真珠チラシ/バック色合わせ（バックの地色は合わせる）<br>カメラマン/撮影環境などが同じと思われる画像バック地色は合わせる。<br>↳本来、上記の環境で撮影された場合、バック地色は同じ様に見える筈である。<br>↳紙面で並べて記載した場合、バック地色がバラバラだとNG（地色統一が求められる）<br><br>・薄い色での統一は難しいが合わせなければならない<br>・DS-07892482-02A.epsとDS-07892490-02A.epsが合っていない（赤紫と青紫に見える）</p><p>&nbsp;</p><p><strong>【参考画像】</strong><br>FFFTP&gt;画像レタッチ見本＆作業注意点PDF&gt;20210105大地_バック色合わせ<br>YUIDEA修正　/　ベトナム修正<br>上記のそれぞれのホルダーに入れています。</p><p>&nbsp;</p><p><strong>【トラブルの原因】</strong><br><span style=\"color:black;\">Bridgeなどで画像全体の把握をしていない？</span></p><p>&nbsp;</p><p><strong>【改善方法】</strong><br><span style=\"color:black;\">(1)Bridgeなどで画像全体の把握</span><br><span style=\"color:black;\">(2)画面の左右で色が違って見える場合があるので、画像を画面内で動かして確認する。</span><br><span style=\"color:black;\">↳本来、左右上下どこで画像を表示しても「同じ色」に見える様にする為に</span><br><span style=\"color:black;\">&nbsp; モニターキャリブレーションを行うのだが、ベトナムモニターは</span><br><span style=\"color:black;\">&nbsp; キャリブレーション対応が難しい為、難しい薄い色の場合は、画像レタッチした後に</span><br><span style=\"color:black;\">&nbsp; 動かして確認してみる必要があるかもしれない。</span><br><span style=\"color:black;\">※モニターでの原因を小林は確認できないので、ベトナムで確認して下さい。</span></p>','24,36,37,34,25,49,45,21,38,42,1','2021-01-06 10:08:33','2021-01-07 11:03:58'),(39,'nt_0039',2,'Đồng bộ màu sản phẩm','20210106大地_商品色合わせ','2021-01-06 12:13:00','25','321',NULL,NULL,NULL,NULL,NULL,'ja',1,'Notice','<p>Đồng bộ màu sản phẩm</p><p>Nội dung】2021/1/6</p><p>Đồng bộ tổng thể và sản phẩm</p><p>↳Khi đăng lên cùng trang báo nếu tông nó khác là không được</p><p>&nbsp;</p><p>【Tham khảo】</p><p>Hình tham khảo up trên FTPFFFTP&gt;画像レタッチ見本＆作業注意点PDF&gt;&nbsp;20210106大地_商品色合わせ</p><p>YUIDEA修正　/　ベトナム修正</p><p>&nbsp;</p><p>【Nguyên nhân】</p><p>Chắc là do không hiểu tổng thể hình trên Bridge..</p><p>&nbsp;</p><p>【Cách cải thiện】</p><p>(1) Hiểu được tổng thể hình trên Bridge...</p><p>(2) Vì không có mẫu nên cũng khó phân biệt được đâu là màu sản phẩm thật. Trong trường hợp đó, hãy chọn một hình ảnh mà mình cảm nhận là ok nhất &nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>※Không hiểu tổng thể hình giống cái Trouble 大地_真珠チラシ/バック色合わせ</p><p>&nbsp;</p><p>・Giống nền</p><p>・Giống sản phẩm</p><p>・Giống sắc mặt</p><p>※Hình được đăng trên báo phải đồng bộ những điều chú ý trên đây</p>','<p><span class=\"text-big\"><strong>大地_商品色合わせ</strong></span><br><br><strong>【トラブルの内容】2021/1/6</strong><br>商品と全体の雰囲気を合わせる<br>↳紙面で並べて記載した場合、商品/全体の雰囲気が違うとNG</p><p>&nbsp;<strong>【参考画像】</strong><br>FFFTP&gt;画像レタッチ見本＆作業注意点PDF&gt;&nbsp;20210106大地_商品色合わせ<br>YUIDEA修正　/　ベトナム修正<br>上記のそれぞれのホルダーに入れています。</p><p>&nbsp;<strong>【トラブルの原因】</strong><br><span style=\"color:black;\">Bridgeなどで画像全体の把握をしていない？</span></p><p>&nbsp;<strong>【改善方法】</strong><br><span style=\"color:black;\">(1)Bridgeなどで画像全体の把握</span><br><span style=\"color:black;\">(2)見本が無いので、どの色が本当の商品の色か？判別できないと思います。</span><br><span style=\"color:black;\">&nbsp; &nbsp; &nbsp;その際は、コンデションが良いと思われる画像をチョイス（ほぼ、置き撮りに合わせる）</span></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><span class=\"text-big\">※大地_真珠チラシ/バック色合わせ（バックの地色は合わせる）と</span><br><span class=\"text-big\">　同様に全体の画像把握が出来ていません。</span></p><p>・バック（雰囲気）を合わせる<br>・商品を合わせる<br>・顔色合わせる<br>※紙面に掲載さた事をイメージし上記の注意を反映して下さい。</p>','24,34,37,1,42,21,,36,45,49,38','2021-01-06 10:17:14','2021-01-06 15:00:25'),(50,'tb_0050',2,'Mistake trong việc ghép image','角版合成の大事なミス','2021-01-06 11:56:00','24','321',NULL,58,5,NULL,NULL,'vi',0,'Trouble','<p><strong>Nội dung: Mắc lỗi nghiêm trọng trong việc ghép image</strong></p><p>↳Sử dụng file không đúng.</p><p>↳Làm không theo hướng dẫn</p><p><strong>【Nguyên nhân】</strong></p><p>(1) Nhân viên xem 2 file như nhau nên đã lấy file cũ làm tiếp.</p><p>(2) Nhân viên hiểu sai hướng dẫn nhưng không check kỹ lại với người dịch.</p><p>&nbsp;</p><p><strong>【Cách cải thiện】</strong></p><p>(1) Cấm nhân viên sử dụng folder trước đó.</p><p>(2) Job nào có hướng dẫn đặc biệt, Nancy sẽ giải thích kĩ và kiểm tra trước khi bàn giao.</p><p>(2) Không xoá hình ảnh gốc để Nhân-san có thể kiểm tra.&nbsp;</p><p>&nbsp;</p><p>[Ghi chú từ Chị Wa]</p><p>＞(1) Nhân viên xem 2 file như nhau nên đã lấy file cũ làm tiếp.</p><p>Cái lỗi này giống y như lần trước</p><p>Staff đã không biết cái mình làm lần trước đã bị sai</p><p>Trong mail ngày 23 tháng 12 cũng có gửi kèm PDF mẫu bên Nhật đã sửa cho pathstaff</p><p>Khi có lỗi gì đó nhớ là phải nhắc cho tất cả Mọi người, chia sẻ để không tái phạm nữa</p><p>&nbsp;</p>','<p>日付：2021/01/6</p><p>案件名：j_【コトコト生活用品】_合成1点」</p><p>角版同士の合成指示に対し、切り抜き同士の合成としてしまった。（大事なミス）</p><p>↳前回作業したファイルを使った。</p><p>↳伝票の指示に従っていませんでした。 &nbsp;</p><p>&nbsp;</p><p><strong>【トラブルの原因】</strong></p><p>(1) スタッフは今回の入稿も同じだ思いましたので、前回作業したファイルを使用していました。</p><p>(2) スタッフは指示を誤解しているが、ナンシーに確認していませんでした。</p><p>&nbsp;</p><p><strong>【改善方法】</strong></p><p>(1) 前回のデータを使用することを禁止します</p><p>(2)特別な指示があれば、ナンシーはちゃんと説明して、アップの前にチェックします。</p><p>(2) Nhanさんが確認できるように、元の画像を削除しません。</p><p>&nbsp;</p><p>【渡辺追記】<br>＞(1) スタッフは今回の入稿も同じだ思いましたので、前回作業したファイルを使用していました。</p><p style=\"text-align:justify;\">前回も同じミスで注意しています。</p><p style=\"text-align:justify;\">スタッフは前回の作業が間違っていたと知らなかったということです。</p><p style=\"text-align:justify;\">前回は12月23日にPathstaff宛てに修正後の見本PDFも添付してメールを送っていますし、</p><p style=\"text-align:justify;\">このレポートにも記載があります。</p><p>ミスは全員に説明して理解してもらってください。</p>','24,36,37,21,49,45,34,,18,42,1','2021-01-08 12:01:54','2021-01-19 09:29:36'),(51,'tb_0051',2,'EC PDF số 106','カタログ大地106号のECサイト用PDF','2021-01-14 16:31:00','24',NULL,NULL,481,6,NULL,NULL,'ja',0,'Trouble','<p>Ngày tháng: 2021/01/14</p><p>Tên Job: EC PDF số 106</p><p>Nội dung lỗi: Sử dụng dữ liệu cũ số 146</p><p>↳Đã phát sinh lỗi khi chỉnh trang số 9</p><p>&nbsp;</p><p>[Nguyên nhân】</p><p>(1) Vì vẫn còn dữ liệu cũ &nbsp;</p><p>(2) Phát sinh lỗi khi tham khảo dữ liệu cũ</p><p>&nbsp;</p><p>[Biện pháp】</p><p>(1) Tạo file txt trong work Space của Daichi</p><p>(2) Kiểm chéo</p><p>(3)Xóa file cũ định kì</p><p>&nbsp;</p><p>[Từ Anh Kobayashi]&gt; (3)Xóa file cũ định kì. Làm định kì cũng không có ý nghĩa. Mỗi sáng, trước khi bắt đầu vào công việc hãy xóa dữ liệu cũ đi</p><p>Lần này cũng bị lỗi như lần trước, cũng xảy ra sự cố do không xóa dữ liệu cũ. Cứ hễ còn dữ liệu cũ thì cũng có ngày lại lấy lộn tiếp vì là con người sao toàn vẹn được, thế nào cũng có lúc quên mình đang làm số nào, dữ liệu nào. Cách tốt nhất để không nhầm là xóa cái cũ đi, cái không cần xóa đi</p><p>Dữ liệu cũ bên YUIDEA có backup mà vậy còn để lại dữ liệu cũ chi, việc này hoàn toàn không có ý nghĩa</p><p>Từ giờ, khi đưa giao việc cho bên Path làm Anh Yo và Chị Yo phải có trách nhiệm đảm bảo là không còn cái gì hết, bỏ sạch hết cái cũ cái ko liên quan</p><p>Anh Yo và Chị Yo mỗi ngày phải quản lý cái vụ không để còn lại dữ liệu cũ. Buổi sáng phải check xem đã chắc là xóa hết dữ liệu cũ chưa. Còn nếu không chắc có nên xóa hay không thì phải tạo folder đã làm để riêng ra, còn chỗ sẽ làm tuyệt đối là trống trơn.</p><p>Theo Anh Koba nghĩ thì ngoài dữ liệu cần backup ra thì cứ xóa hêt đi. Chứ cứ để lưu tùm lum thì chỉ có mang đến rủi ro thôi. Tôi không hiểu để lại cái cũ chi để rồi phải gánh thêm rủi ro</p>','<p>日付：2021/01/14</p><p>案件名：カタログ大地106号のECサイト用PDF</p><p>中身が2020年の146号のデータでした。（大事なミス）</p><p>↳9ページの念校修正の時にミスをした。</p><p>&nbsp;</p><p>【トラブルの原因】</p><p>(1) 146号のデータが残っていたから。</p><p>(2) 過去のデータを参照する時にミスをした。</p><p>&nbsp;</p><p>【改善方法】</p><p>(1) txtファイルをDaichiのwork Spaceに作ります。</p><p>(2) 別の人にチェックをしてもらいます。</p><p>(3) 古いファイルを定期的に削除します。</p><p>&nbsp;</p><p>【小林より】<br>&gt;(3) 古いファイルを定期的に削除します。<br>定期的では駄目です。毎朝、仕事がスタートする際には“削除”した後でスタートして下さい。</p><p>今回も（過去に同じミスがあります）作業済データを“削除”しない為に起こった事故です。<br>「過去データになってしまう」これは削除しなかったからです。<br>↳号数とか、どのデータを作業するとか、人間は間違えてしまうものです。<br>↳間違えない方法は一つ“余計なデータは削除する”です。</p><p>過去データはYUIDEAでバックアップを取っていますので<br>「過去データを残す意味は全くありません」</p><p>今後はYUIDEA（横手or吉田）がベトナム作業場（ホルダー）を管理し朝一には何も無い状態にしベトナムには業務を始めて貰います。</p><p>&nbsp;</p><p>横手さん、吉田さん<br>ベトナムからリモート作業するスペースは日々管理して下さい。<br>↳第一階層に過去データが無い様に、朝確認して下さい。<br>↳削除に躊躇する？のでしたら[作業済ホルダー]を作成し作業ホルダーはゼロにして下さい。</p><p>小林の考えは「過去データ」はバックアップしたもの以外は“削除”が基本だと思っています。<br>他に残しておくのはリスクでしかありません。リスクを背負ってまで残す意味が解りません。<br>&nbsp;</p>','24,36,37,21,49,45,34,,18,42,38,1','2021-01-15 16:49:37','2021-01-19 09:55:23'),(52,'tb_0052',2,'20210128BCザクザクの画像レタッチ_Đồng bộ màu','20210128BCザクザクの画像レタッチ_色合わせ','2021-01-28 11:45:00','25','321',NULL,58,5,NULL,NULL,'ja',0,'Trouble','<p style=\"margin-left:42.0pt;\"><strong>【</strong>Nội dung<strong>】</strong></p><p>20210128BCザクザクの画像レタッチ_Đồng bộ màu<br>↳Đồng bộ màu sản phẩm</p><p>Trong cuốn catalog trường hợp dàn hình giống, thì phải đồng bộ màu sản phẩm<br>↳Chỉ 1 tấm hình bị khác màu thì cũng là không được</p><p>&nbsp;</p><p>Tay cầm màu cam ở giữa đang bị hơi vàng<br>　↓<br>Trường hợp này, tay cầm hình chính giữa chỉnh cam lên</p><p>※BC_004_0782S_ベトナム作成.eps<br>　↳Cái này không đồng bộ với mấy cái khác<br>　↳Hãy kiểm tra hình trên Photoshop</p><p><br><br><strong>【H</strong>ình Tham khảo<strong>】</strong></p><p>FFFTP&gt;画像レタッチ見本＆作業注意点PDF&gt;20210128BCザクザクの画像レタッチ_色合わせ<br>&nbsp;</p><p><strong>【</strong>Nguyên Nhân<strong>】</strong></p><p>Hiểu tổng thể trên Bridge, kiểm tra mỗi sản phẩm có đồng bộ màu không。</p><p><strong>&nbsp;</strong></p><p><br><strong>【</strong>Cách cải thiện<strong>】</strong></p><p>[Theo ý kiến Anh Koba]<br>①Khi bắt đầu làm mình tiến hành chia thư mục path, color và các kích thước&nbsp;<br>②Sau khi làm xong, trên Bridge gom lại thành 1 và check từng sản phẩm có đồng bộ màu chưa</p><p><br>※Đây là đề xuất của anh Kobayashi, nhưng không biết là có phù hợp với VN không, Mọi Người bàn bạc và cho ý kiến để có hướng khắc phục</p>','<p style=\"margin-left:42.0pt;\"><strong>【トラブルの内容】</strong></p><p>20210128BCザクザクの画像レタッチ_色合わせ<br>↳商品の色をあわせる。</p><p>カタログでは同じ商品カットが並んでいる場合には、商品色を合わさなくてはならない。<br>↳1カットだけ、違う色となっている事はNG。</p><p>&nbsp;</p><figure class=\"image image-style-align-left\"><img src=\"http://jobtime.cetusvn.net/data/reports/NQHdD7f49Lm1xYDjBeEhS8MBCpA9G5rtpifa9tyP.jpeg\"></figure><p>両サイドの画像の取っ手はオレンジ<br>真ん中の画像の取っ手は黄色っぽい<br>　↓<br>この場合、真ん中の画像の取っ手を<br>両サイドの画像に合わせオレンジにする。</p><p>※BC_004_0782S_ベトナム作成.eps<br>　↳これも他のカットに合っていません。<br>　↳Photoshopで画像確認して下さい。</p><p><br><br>&nbsp;</p><p><strong>【参考画像】</strong></p><p>FFFTP&gt;画像レタッチ見本＆作業注意点PDF&gt;20210128BCザクザクの画像レタッチ_色合わせ<br>&nbsp;</p><p>&nbsp;</p><p><strong>【トラブルの原因】</strong></p><figure class=\"image image-style-align-left\"><img src=\"http://jobtime.cetusvn.net/data/reports/PQdxraSRAU61Kp5RUYN5W7XPkbu4nntr3X2yoDTm.jpeg\"></figure><p>Bridgeで全体を把握し、商品毎に<br>「色が合っているか？」を確認する。</p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><br>&nbsp;</p><p>&nbsp;</p><p><strong>【改善方法】</strong></p><p>[小林案]<br>①ベトナムでは各サイズ/切り抜き/角版でホルダー分けを最初に行い作業をスタートしている。<br>②作業終了した時に「1つにまとめ」Bridgeで商品毎に色が合っているか？を確認。</p><p><br>※小林の提案が可能か？否か？メンバーで話し合って「商品で色合わせ」が<br>　可能なフローを考えて下さい。　</p>','24,34,37,36,49,21,42,,1','2021-01-28 09:47:03','2021-01-28 14:27:55');

